import React, { Component } from 'react';
import { Link } from "react-router-dom";
import { Navbar, Nav, Button, Dropdown, Form, Collapse } from 'bootstrap-4-react';



class NavbarItems extends Component {
    constructor(props){
        super(props);
        const auth = sessionStorage.getItem('userAuth');
        if(auth !== 'Success'){
            this.state = {
                navitems:[
                    {
                        id: 1,
                        name: "Home",
                        url : "/"
                    },
                    {
                        id: 2,
                        name: "Login",
                        url : "/login"
                    },
                    {
                        id: 3,
                        name: "Signup",
                        url : "/signup"
                    },
                ]
            }
        } else {
            this.state = {
                navitems:[
                    {
                        id: 1,
                        name: "Home",
                        url : "/"
                    },
                    {
                        id: 2,
                        name: "Profile",
                        url : "/profile"
                    }, 
                    {
                        id: 3,
                        name: "Logout",
                        url : "/logout"
                    },
                ]
            } 
        }
    }
    render() {
        return this.state.navitems.map( nav => {
            return(
                <div>
                    <Navbar expand="lg" light bg="light">
                        <Navbar.Brand href="#">
                        Navbar
                        </Navbar.Brand>
                        <Navbar.Toggler target="#navbarSupportedContent" />
                        <Collapse navbar id="navbarSupportedContent">
                        <Navbar.Nav mr="auto">
                            <Nav.Item active>
                            <Nav.Link href="#">Home</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                            <Nav.Link href="#">Link</Nav.Link>
                            </Nav.Item>
                            <Nav.Item dropdown>
                            <Nav.Link dropdownToggle>Dropdown</Nav.Link>
                            <Dropdown.Menu>
                                <Dropdown.Item>Action</Dropdown.Item>
                                <Dropdown.Item>Another action</Dropdown.Item>
                                <Dropdown.Divider />
                                <Dropdown.Item>Something else</Dropdown.Item>
                            </Dropdown.Menu>
                            </Nav.Item>
                            <Nav.Item>
                            <Nav.Link disabled>Disabled</Nav.Link>
                            </Nav.Item>
                        </Navbar.Nav>
                        <Form inline my="2 lg-0">
                            <Form.Input type="search" placeholder="Search" mr="sm-2" />
                            <Button outline success my="2 sm-0">Search</Button>
                        </Form>
                        </Collapse>
                    </Navbar>
                    <ul>
                        <li key={nav.id} className="item-card">
                            <Link to={nav.url}>{nav.name}</Link>
                        </li>
                    </ul>
              </div>
              );
          }
        )
    };
}

export default NavbarItems;
